export default function CountryPage_Header({name, flag}) {
    console.log(flag)
    return (
        <span className="ContryInfoHeader">
            <p className="ContryInfoHeader-name">{name}</p>
            {flag ? (<img className="ContryInfoHeader-flag" src={flag}/>) : (<></>)}
        </span>
    )
}
